import "../style.css";
import React from "react";
import axios from "axios";

function Details() {
  const apiURL = `https://api.openweathermap.org/data/2.5/forecast?q={city name}&appid={API key}`;

  axios
    .get(apiURL)
    .then((res) => {
      console.log(res.data);
    })
    .catch((err) => {
      console.log(err);
    });

  return <div>Test Forecast</div>;
}

export default Details;
